  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Structures are derived from two scales
  of a focal mean analysis on bathymetry and slope. The grid is based on gridded (5
  m cell size) multibeam bathymetry, collected aboard NOAA Ship Oscar Elton Sette.
  The grid is derived from gridded (5 m cell size) bathymetry and was created using
  the Benthic Terrain Modeler 3.0 (Beta 3). The Cell values represent one of 13 classes
  in an index of seafloor terrains. The bathymetry grid includes multibeam bathymetry
  from the Reson 8101 multibeam sonar aboar the NOAA Ship Oscar E. Sette collected
  as of May 2010 by the NOAA Coral Reef Ecosystem Division in depths between 10 and
  300 meters. These data complement multibeam data collected by the U.S. Naval Oceanographic
  Office at FDM during several test cruises, which are available from NOAA's National
  Geophysical Data Center.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
